function UserForm() {

  const [firstname, setFirstName] = useState("");

  return (
    <form>
      <label>First Name:
        <input type="text" 
        value={firstName}
        onChange={(e) => setName(e.target.value)}
        />
      </label>

      <label>Last Name:
        <input type="text" />
      </label>

      <label>Email:
        <input type="text" />
      </label>

      <label>Phone number:
        <input type="text" />
      </label>

      <label>Profile Image:
        <input type="text" />
      </label>
    </form>
  )
}

export default UserForm;
